Este poema es un soneto humorístico escrito por el poeta mexicano Manuel Gutiérrez Nájera (1859-1895), quien fue uno de los principales representantes del modernismo en México. El poema juega con palabras y nombres chinos mezclados con anglicismos, creando un efecto cómico y cosmopolita típico del período modernista.
